function onCashPayment(data) {
  ue.game.callevent(
    "OnPayment",
    JSON.stringify({
      type: "cash",
      data
    })
  );
}

function onCardPayment(data) {
  ue.game.callevent(
    "OnPayment",
    JSON.stringify({
      type: "card",
      data
    })
  );
}

function onClose() {
  ue.game.callevent("OnClose");
}

function ResetBasket() {
  window.dispatchEvent(new CustomEvent("@Burdigalax-shop:resetBasket"));
}

