function SetError() {
  window.dispatchEvent(
    new CustomEvent("@Burdigalax-shop:paymentError", {
      detail: { title: "Erreur", message: "Le système bancaire est KO !" }
    })
  );
}

function SetSuccess() {
  window.dispatchEvent(
    new CustomEvent("@Burdigalax-shop:paymentSuccess", {
      detail: { title: "Félicitation", message: "Paiement validé" }
    })
  );
}

window.addEventListener("@Burdigalax-shop:cashPayment", onCashPayment);
window.addEventListener("@Burdigalax-shop:contactLessPayment", onCardPayment);
window.addEventListener("@Burdigalax-shop:cardPayment", onCardPayment);
window.addEventListener("@Burdigalax-shop:onClose", onClose);
